// Mapa de meses
const mesesMap = {
    'Janeiro': 1,
    'Fevereiro': 2,
    'Mar√ßo': 3,
    'Abril': 4,
    'Maio': 5,
    'Junho': 6,
    'Julho': 7,
    'Agosto': 8,
    'Setembro': 9,
    'Outubro': 10,
    'Novembro': 11,
    'Dezembro': 12
};

document.addEventListener('DOMContentLoaded', function() {
    const monthButtons = document.querySelectorAll('.month-btn');
    const birthdayList = document.querySelector('.birthday-list');
    
    // Selecionar o m√™s atual por padr√£o
    const dataAtual = new Date();
    const mesAtual = dataAtual.getMonth() + 1;
    
    monthButtons.forEach(button => {
        // Ativar o bot√£o do m√™s atual
        if (mesesMap[button.textContent] === mesAtual) {
            button.classList.add('active');
            loadBirthdays(button.textContent);
        }
        
        button.addEventListener('click', function() {
            // Remove active class from all buttons
            monthButtons.forEach(btn => btn.classList.remove('active'));
            // Add active class to clicked button
            this.classList.add('active');
            
            loadBirthdays(this.textContent);
        });
    });

    createBalloons();
});

function loadBirthdays(month) {
    const mesNumero = mesesMap[month];
    const aniversariantes = getAniversariantesDoMes(mesNumero);
    const birthdayList = document.querySelector('.birthday-list');
    
    if (aniversariantes.length > 0) {
        birthdayList.innerHTML = aniversariantes.map(aniv => `
            <div class="birthday-card">
                <div class="birthday-avatar">
                    <img src="${aniv.foto}" alt="Foto do aniversariante">
                </div>
                <div class="birthday-info">
                    <h3>${aniv.nome}</h3>
                    <p class="birthday-date">${aniv.data}</p>
                    <p class="birthday-department">${aniv.departamento}</p>
                </div>
            </div>
        `).join('');
    } else {
        birthdayList.innerHTML = '<p class="no-birthdays">Nenhum aniversariante neste m√™s</p>';
    }
}

// Fun√ß√£o para obter aniversariantes do m√™s
function getAniversariantesDoMes(mes) {
    return dadosAniversariantes.filter(aniv => {
        const mesAniv = parseInt(aniv.data.split('/')[1]);
        return mesAniv === mes;
    });
}